  state = {
    rightTitleShown: false,
    leftTitleShown: false
  }

  onRightHover = (e) => {
    this.setState({ rightTitleShown: true });
  }

  onLeftHover = (e) => {
    this.setState({ leftTitleShown: true });
  }

  render(){

    return(
      <Row>
        <Col></Col>
        <Col></Col>
      </Row>
    )
  }

}

